var Core = require("leanft.sdk.core");
var ObjUtils = Core.ObjectUtils;
var TestObjectBase = Core.TestObjectBase;
var DescriptionBase = Core.DescriptionBase;

/**
 * Terminal Emulators namespace
 * @namespace TerminalEmulators
 */


/**
 * TeBaseDescription - Description for all terminal emulator elements
 * @class TeBaseDescription
 * @memberof TerminalEmulators
 * @extends DescriptionBase
 * @ignore
 */
function TeBaseDescription(leanFTType){
    this._init({
        technology: "Terminal Emulators",
        leanftType: leanFTType
    });
}
/**
 * Common description methods for all terminal emulator elements
 * @memberof TerminalEmulators
 * @ignore
 */
ObjUtils.inherit(TeBaseDescription, DescriptionBase, {
});

/**
 * A TeBaseTO object
 * @class TeBaseTO
 * @memberof TerminalEmulators
 * @constructor
 * @extends TestObjectBase
 * @ignore
 */
function TeBaseTO(nativeClass,session,description) {
    this._init(nativeClass,session,description);
}

/**
 * @ignore
 */
ObjUtils.inherit(TeBaseTO,TestObjectBase,{
});

module.exports.TeBaseDescription = TeBaseDescription;
module.exports.TeBaseTO = TeBaseTO;